  false,\n\t\"url\": null,\n\t\"notes\": \"This is a plan for effective enforcement
  of existing laws and regulations governing public use and enjoyment of the Refuge's
  resources. The objectives of the Refuge's Law Enforcement Programs are; equitable
  distribution of opportunities for utilization, of fish and wildlife resources, protection
  of federal property and the quality values of the resources, safe use of federal
  lands by the public, and preventive law enforcement program keeping public informed
  through media, published regulations, and proper posting.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
